    def _nearest(row, right_df, max_distance, exclusive):
        if max_distance is None:
            max_distance = np.inf

        if exclusive:
            right_df = right_df.loc[~right_df.intersects(row.geometry)]

        distances = right_df.distance(row.geometry)
        min_distance = distances.min()

        if min_distance <= max_distance:
            nearest = right_df.iloc[distances.idxmin()]
            if distance_col:
                row[distance_col] = min_distance
            return pd.Series(nearest)

        return pd.Series([np.nan] * len(right_df.columns))

    sjoin = left_df.apply(_nearest, axis=1, right_df=right_df, max_distance=max_distance, exclusive=exclusive)
